import React, { Component } from 'react'
import "./blue.css"

export default class App extends Component {
    constructor(props){
        super()
    }
    render() {
        return (
            <div id="app-container">
                <div class="stars-sm"></div>
                <div class="stars-m"></div>
                <div class="stars-l"></div>
                <div id="app"></div>
            </div>
        )
    }
}
